9:10 &quot;Ich werde alle Fragen beantworten, egal wie unangenehm sie sind...&quot;
9:24 &quot;Ich bin ein Mensch der sehr viel Selbstkontrolle hat.&quot;
31:06 &quot;Ich reiche euch mal wieder den Strohhalm. Das habe ich in der Vergangenheit schon öfter gemacht.&quot;
Du schätzt dich wieder mal völlig falsch ein. Auch das mit dem Strohhalm ist völliger Blödsinn! Ich vermute stark, dass dein Jubiläumsevent sowieso nach hinten losgeht und auch keiner von den großen Youtubern kommen wird. Aber ich würde mich tatsächlich freuen wenn z.B. Chan auftauchen würde. Er ist auch ein großer Narzisst, aber zeigt es nicht unbedingt so offen wie du. Von ihm kannst du sicherlich noch so einiges lernen, oder es wird sich einfach nur ein großes Narzissmusfeuerwerk entladen. So oder so, wir kennen bereits dein Verhalten wenn du kritisiert wirst. Ändern wird sich daran ohne psychologische Hilfe wohl kaum etwas.
